import React from 'react';

const Offer = ({ name, text }) => {
    return (
        <div className="offer">
            <div className="offer-name">
                {name.ru}
            </div>
            <div className="offer-text">
                {text.ru}
            </div>
        </div>
    )
}

export default Offer;
